import React, { Component } from "react";
import Layout from "../../components/Layout";

class Theresume extends Component{
    
    render(){
        return(
            <Layout>
                <div className="container">
                    <div className="row d-flex justify-content-center shadow-lg p-3 mb-5 bg-white rounded">
                        <h1>The Resume Game</h1>
                        <iframe frameborder="0" src="https://itch.io/embed-upload/1857824?color=333333" allowfullscreen="" width="940" height="510">
                            <a href="https://msomsap.itch.io/the-resume-game">Play The  Resume Game on itch.io</a>
                        </iframe>                    
                    </div>
                <br/>
                </div>                 
            </Layout>               
        )
    }
}

export default Theresume;
